import Link from 'next/link'
import React from 'react'

const Nav = () => {
    return (
        <>
            <Link style={back} href="/order"> Order </Link>
            <Link href="/sell"> Sell </Link>
            <Link href="/contact"> Contact</Link>
            <Link href="/account"> Account </Link>
        </>
    )
}

export default Nav
